import React from "react";

const Jobs = props => (

    <div className="container">
        <div className="row">

            {
                props.jobs.map((job) => {

                    return (

                        <div className="col-md-4" key={job.id}>

                            <div className="recipe__box">

                                <img className="recipe__box-img" src={job.company_logo} alt={job.company} />

                                <div className="recipe__text">

                                    <h5><b>Company:</b> { job.company }</h5>
                                    <hr />
                                    <h5><b>Title:</b> { job.title }</h5>

                                </div>

                            </div>

                        </div>

                        // <div >


                        //     

                        // </div>
                    );
                }) 
            }

        </div>

    </div>
);

export default Jobs;
